Mark has just taken over the new acquisitions department at a publishing company and is meeting with his staff, including Mariah, who he\'s found out is a budding author. She had been keeping her novel a secret, and is embarrassed when he says that he\'s read, and enjoyed it. To make matters worse, the material is sexually charged, which he confronts her about. Well she thinks, now that the cat\'s out of the bag, may as well tell him how she gets her inspiration, and better yet show him. What happens next will surely find it\'s way into her new book of sexual exploits!
